style.css:
@-moz-document domain(portal.dinus.ac.id), url-prefix('https://portal.dinus.ac.id/') { 
    
#header-part {
  display: none;
}



#page-banner {
    padding-top: 10px;
    padding-bottom: 10px;
}

#page-banner > div > div > div > div > h2 {
    font-size: 32px;
    color: #fff;
    padding-bottom: 12px;
}

body > section.signup.pt-105.pb-120.gray-bg {
    padding-top: 20px;
    padding-bottom: 20px;
}

body > section.signup.pt-105.pb-120.gray-bg > div > div > div > form > h3 {
  display: none;
}

body > section.signup.pt-105.pb-120.gray-bg > div > div > div > form > hr {
  display: none;
}

body > section.signup.pt-105.pb-120.gray-bg > div > div > div {
    border-radius: 10px;
    padding: 20px 25px;
    margin: 0 25px;
}

}
